import React from "react";

const List = () => {
  const [timesheets, setTimesheets] = useState([]);
  return (
    <ul>
      {props.time.map((el, index) => (
        <button key={index} onClick={() => props.handleClick(index)}>
          Client: {el.client} Date: {el.date}
        </button>
      ))}
    </ul>
  );
};

export { List };
